import "./Logs.css"
// 日志的容器
const Logs = () => {
  // 模拟一组从服务器中加载的数据
  const logsData = [
    {
      date: new Date(2021,1,20,18,30),
      desc: '学习九阳神功',
      time:30
    },
    {
      date: new Date(2021,2,10,12,30),
      desc: '学习降龙十八掌',
      time:20
    },
    {
      date: new Date(2021,2,21,11,30),
      desc: '学习Js',
      time:40
    }
  ]
  return 
    <div className="Logs">
      {
        logsData.map(item=> <LogItems date={item.date} desc={item.desc} time={item.time}/>)
      }
    </div>
}

export default Logs
